import React, { Component } from 'react';
import Navbar from './components/navbar';

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            account : '0x0'
        }
    }
    render() { 
        return (
            <Navbar account={this.state.account} />
        );
    }
}
 
export default App;
